import './Footer.css'
function Footer() {
  //JSX como o react le e tranforma elementos no DOM
  return (
    <header>

      <footer className=" pt-md-3 bg-color">
        <div className="row">
          <div class="col-4 col-md">
            <img class="mb-2" src="/images/ac_logo_white.png" alt="" width="250" height="46" />

          </div>

        </div>
      </footer>

    </header>
  )
}
export default Footer
